import React from "react";
import { View } from "react-native";
import avatar from "../../../assets/avatar.png";
import { Container, Header, Title } from "./styles";

const Activitites = () => {
  return (
    <Container>
      <Header>
        <Title>Atividades</Title>
      </Header>

      <Card>
        <CardHeader>
          <Avatar source={avatar} />
        </CardHeader>
      </Card>
    </Container>
  );
};

export default Activitites;
